    false,nt"url": null,nt"notes": "The Upper Mississippi River National Wildlife
    and Fish Refuge consists of approximately 194,000 acres of wooded islands, waters
    and marshes extending southward along the river bottoms from Wabasha, Minnesota
    to near Rock Island, Illinois. The Fire Management Program is designed to provide
    the following objectives: 1) Improved wildlife habitat: Prescribed fire provides
    improved habitat for waterfowl, upland game species, and non-game species through
    removal of encroaching woody vegetation and enhancement of favored food and cover
    species through removal of competing plants, 2) Perpetuation of natural areas: Native
    grasslands can be maintained with periodic burning. Fire reduces encroachment by
    woody species and creates favorable seedbeds for grasses. 3) Improved timber stands:
    Prescribed fire can be utilized to manage understory vegetation through removal
    of undesirable species that compete for nutrients and growing space. 4) Hazard reduction:
    Deposition of flood debris, wind blow down timber create concentrations of heavy
    fuels. Fire effectively reduces this wildfire hazard. 5) Levee protection: Many
    wildlife areas on the Refuge are protected by levees. Sod forming grass cover on
    both faces of the levees is essential to insure their stability. Prescribed fire
    retards encroachment by woody vegetation and encourages growth of grasses.",nt"license_title":
